import React from "react";
import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Landing from "./components/Landing";

const App = () => {
  return (
    <BrowserRouter>
      <div>
      <Switch>
      <Landing />
      </Switch>
      </div>
    </BrowserRouter>
  );
};

export default App;
